  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:25.627367\",\n\t\"name\": \"steigerwald-lake-national-wildlife-refuge-narrative-report-1992-calendar-year\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Steigerwald
  Lake NWR outlines Refuge accomplishments during the 1992 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. The report
  includes a planning section which discusses the master plan, management planning,
  and research and investigations. Refuge administration is outlined; information
  about personnel, volunteer programs, funding, and technical assistance is given.
  Habitat management is also covered; subjects include wetlands, forests, grazing,
  haying, pest control, and water rights. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, raptors, game mammals, and fisheries resources. The public uses of the
  Refuge described in this report include outdoor classrooms and outdoor recreation.
  The equipment and facilities section of the report provides information about new
  construction. Cooperative programs are provided at the end.\",\n\t\"license_title\":
